import{links}from"./links.js";import{ecosystem}from"./ecosystem.js";links(),ecosystem();const button=document.querySelector(".home__subname"),contractParagraph=document.querySelector(".home__item p"),tooltip=document.querySelector(".home__tooltip");button.addEventListener("click",(function(){const t=contractParagraph.textContent;navigator.clipboard.writeText(t).then((()=>{tooltip.classList.add("visible"),setTimeout((()=>{tooltip.classList.remove("visible")}),2e3),button.blur()})).catch((t=>{console.error("Error when copying contract address:",t)}))}));